Wikipedia - Eyesaver Skin

Update:
20. Feb. 2009 {minor cosmetic tweaks}
24. Feb. 2009 {style cleaning and optimizations}
01. Mar. 2009 {Search Forms Styled}
22.May. 2009 {PowerSearch form styled, offsite imageshack images converted to base64 string resulting in faster loads}

css:
/* 
 * Wikipedia - Eyesaver Skin
 *
 * Author         : purpler | http://www.purplerspace.com/
 * Created       : February 19th, 2009
 * Updated       : May 22nd, 2009
 * Portfolio       : http://purpler.deviantart.com/
 * Description   : Wikipedia | Eyesaver by purpler
 * Usage          : Use with Stylish Firefox extension (http://userstyles.org/) or copy to your Firefox userContent.css file
 */

@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix(http://www.wikipedia),url-prefix(http://wikipedia)
{

* {
text-decoration:none !important;
outline:0 !important;
}

/* Resets default Mozilla styling of elements */
input, button, select, textarea, option {
-moz-appearance: none !important;
}

body {
background:#555 !important;
padding-top:25px !important;
font-family:verdana, tahoma, sans-serif !important;
}

a {
color:#888 !important;
}

a:hover {
color:#777 !important;
}

hr { 
border-top:1px dashed #555 !important;
}

/* Kill Bookshelf Image */
img[src="http://upload.wikimedia.org/wikipedia/en/b/bd/Bookshelf-40x201_6.png"] {
display:none !important;
}

/* .org Globe Image */
img[src="http://upload.wikimedia.org/wikipedia/meta/2/2a/Nohat-logo-nowords-bgwhite-200px.jpg"] {
background:url(data:image/png;base64,) no-repeat 35px 35px !important;
width:0 !important;
padding-left:200px !important;
}

/* .org Title Image */
img[src="http://upload.wikimedia.org/wikipedia/commons/6/62/174px-Wikipedia-word1_7.png"] {
background:url(data:image/png;base64,) no-repeat !important;
width:0 !important;
padding-left:174px !important;
}

/* Input, Textfields, Forms */
#searchform fieldset {
background:#555 !important;
border:none !important;
}

input[id=searchInput] {
width:106px !important;
background:url(data:image/png;base64,) no-repeat !important;
padding:2px 8px 2px 20px !important;
border:none !important;
color:#333 !important;
font-size:.9em !important;
text-transform:uppercase !important;
}

select[name=language] {
margin:0 1px !important;
background:#4a4a4a !important;
border:1px solid #777 !important;
color:#999 !important;
}

input[name=go] {
background:#555 !important;
padding:4px !important;
margin:0 1px !important;
color:#999 !important;
font-size:70% !important;
background:#4a4a4a !important;
border:1px solid #666 !important;
}
}

/* Internal Pages */
@-moz-document url-prefix(http://en.wikipedia)
{

* {
text-decoration:none !important;
outline:0 !important;
}

/* Resets default Mozilla styling of elements */
input, button, select, textarea, option {
-moz-appearance: none !important;
}

body {
background:#4a4a4a !important;
font-family:verdana, tahoma, sans-serif !important;
}

#content {
background:#343434 !important;
color:#8e8e8e !important;
border:1px solid #646464 !important;
border-right:none !important;
line-height:1.2em !important;
}

#content {
margin:2.9em 0 0 13em !important;
}

#column-content {
margin:0 0 .6em -14.2em !important;
}

#p-logo a {
background:url(data:image/png;base64,) no-repeat 19px 19px !important;
}

a {
color:#607d8c !important;
font-weight:bold !important;
}

a:visited {
color:#526671 !important;
}

a:hover {
color:#546d7a !important;
}

/* Left Navigation Headers */
h5 { 
color:#8e8e8e !important;
font-size:100% !important;
border:1px solid #666 !important;
border-bottom:none !important;
}

#p-interaction h5, #p-navigation h5, #p-search h5, #p-tb h5, #p-lang h5 {
background:#343434 !important;
padding:6px !important;
display:block !important;
height:1em !important;
text-transform:none !important;
font-size:90% !important;
font-weight:bold !important;
}

/* Styling Search Form */
#searchInput {
margin:5px 0 0 !important;
padding:3px 20px 0 20px !important;
height:17px !important;
width:105px !important;
background:url(data:image/png;base64,) no-repeat !important;
border:none !important;
color:#333 !important;
font-size:.9em !important;
text-transform:uppercase !important;
}

.searchButton, input[value="Search"], input[value="Advanced search"] {
background:#4a4a4a !important;
border:1px solid #666 !important;
cursor:pointer!important;
}

#searchGoButton, #mw-searchButton {
background:#4a4a4a !important;
font-size:.71em !important;
color:#999 !important;
}

/* Navigation */
#column-one {
margin-left:.8em !important;
width:12em !important;
}

#p-cactions a:link {
color:#737373 !important;
}

div#p-interaction div.pBody, div#p-navigation div.pBody, div#p-search div.pBody, div#p-tb div.pBody, div#p-lang div.pBody {
background:#3d3d3d !important;
border:1px solid #555 !important;
padding:0 .8em .3em .5em !important;
}

#p-interaction li a, #p-navigation li a, #p-search li a, #p-tb li a, #p-lang li a {
color:#777 !important;
font-weight:bold !important;
}

#p-interaction li a:hover, #p-navigation li a:hover, #p-search li a:hover, #p-tb li a:hover, #p-lang li a:hover {
color:#666 !important;
}

#p-cactions li {
border:1px solid #333 !important;
border-bottom:none !important;
padding-top: 3px !important;
background:#444 !important;
font-weight: bold !important;
font-size: 110% !important;
margin:0 !important;
}

#p-cactions li.selected {
border:1px solid #646464 !important;
border-bottom:none !important;
background:#646464 !important;
}

#p-cactions li.selected a {
border-bottom:none !important;
background:#343434 !important;
font-weight:bold !important;
color:#737373 !important;
}

#p-cactions li a {
background:#333 !important;
color:#737373 !important;
font-weight:normal !important;
margin:0px !important;
}

#firstHeading, #siteSub {
color:#777 !important;
font-weight: bold !important;
text-transform:capitalize !important;
}

#pt-login a {
background:#333 !important;
border:1px solid #888 !important;
color:#adadad !important;
text-transform:uppercase !important;
font-size:.7em !important;
padding:4px !important;
}

caption {
color:#777 !important;
}

th {
color:#999 !important;
font-weight:bold !important;
}

td {
color:#999 !important;
font-weight:bold !important;
}

th a {
color:#607d8c !important;
}

th a:hover {
color:#546d7a !important;
}

td a {
color:#607d8c !important;
}

td a:hover {
color:#546d7a !important;
}

td span {
color:#999 !important;
font-size:1.1em !important;
}

table {
background:#343434 !important;
}

#mp-topbanner {
background:#343434 !important;
border:none !important;
padding:8px !important;
}

td.MainPageBG, table#mp-left {
border:2px solid #000 !important;
}

#mp-left, #mp-right {
background:#343434 !important;
}

#mp-tfa-h2, #mp-dyk-h2, #mp-itn-h2, #mp-otd-h2, #mp-tfp-h2 {
background:#222 !important;
border:1px solid #555 !important;
}

.infobox, .messagebox {
background:#444 !important;
color:#999 !important;
font-weight:bold !important;
border:1px solid #777 !important;
}

.infobox tbody div {
margin:5px 0 0 !important;
}

.editsection {
color:#777 !important;
}

div#catlinks {
background:#333 !important;
}

#toc  {
background:#2d2d2d !important;
border:1px solid #555 !important;
}

#toctitle h2 {
color:#8e8e8e !important;
}

#togglelink, .toctext, span.mw-headline {
color:#777 !important;
}

.tocnumber {
color:#607d8c !important;
}

input[type=submit] {
padding:0.25em !important;
margin:3px 1px !important;
color:#555 !important;
font-size:70% !important;
font-weight:bold !important;
text-transform:uppercase !important;
}

input[id=searchInput] {
padding:2px 5px !important;
color:#555 !important;
margin-top:2px !important;
}

.tmbox {
background:#414141 !important;
border:1px solid #646464 !important;
}

td.todo-box {
background:#343434 !important;
border:1px solid #646464 !important;
}

td.mbox-text {
font-size:.9em !important;
}

th b {
color:#555 !important;
}

.navbox {
border:1px solid #646464 !important;
}

td.navbox-abovebelow {
background:#292929 !important;
}

table.ambox {
border:1px solid #607d8c !important;
}

table.toccolours th {
background:#292929 !important;
border:1px solid #555 !important;
}

table.infobox td, table.infobox th {
background:#343434 !important;
}

div.thumbinner {
background:#444 !important;
}

.navbox-title {
background:#343434 !important;
}

.navbox-group {
background:#414141 !important;
}

.navbox-list {
background:#414141 !important;
border-left:1px solid #646464 !important;
}

.noprint span {
background:#343434 !important;
}

#catlinks {
border:1px solid #646464 !important;
}

#footer {
display:none !important;
}

/*UPSTREAM ADDITIONS*/
input#searchText, select#searchEngine, input[value="Search"], input#powerSearchText, input[value="Advanced search"] {
background:#222 !important;
color:#8e8e8e !important;
border:1px solid #646464 !important;
}

select#searchEngine, input[value="Search"] {
margin:3px 5px 0!important;
}

div.mw-search-result-data {
color:#607d00!important;
}

input[type="checkbox"] {
background:#222 !important;
color:#8e8e8e !important;
border:1px solid #646464 !important;
}

form#powersearch  fieldset{
border:1px solid #607d8c!important;
}
}
